$injector.get(widgetContext.servicesMap.get('deviceService')).getDevice(entityId.id).subscribe((device) =>{
if(device.type == 'Smart-Soil-Moisture-Sensor'){ 
openDashboardState('soil_moisture_state');}
else if (device.type == 'Smart-Soil-NPK-Sensor'){ 
openDashboardState('soil_npk_state');}
else if (device.type == 'Smart-Soil-pH-Sensor'){ 	
openDashboardState('soil_ph_state');}
else if (device.type == 'Smart-Water-Level-Sensor'){ 
openDashboardState('water_level_state');}
else if (device.type == 'Smart-Water-Valve'){ 
openDashboardState('water_valve_state');}
else if (device.type == 'Smart-Water-Flow-Sensor'){ 
openDashboardState('water_flow_state');}
else if (device.type == 'Smart-Rain-Gauge'){ 
openDashboardState('rain_gauge_state');}
else if (device.type == 'Smart-Anemometer'){ 
openDashboardState('anemometer_state');}
else if (device.type == 'Smart-Air-Quality-Sensor'){ 
openDashboardState('air_quality_state');}
else if (device.type == 'Smart-Rain-Detection-Sensor'){ 
openDashboardState('rain_detection_state');}
else if (device.type == 'Smart-Environmental-Sensor'){ 
openDashboardState('environmental_state');}
else if (device.type == 'Smart-Solar-Radiation-Sensor'){ 
openDashboardState('solar_radiation_state');}
else if (device.type == 'Smart-PAR-Sensor'){ 
openDashboardState('par_state');}

});

